const getCompanyLogo = (company: string): string => {
  const match = companyLogos.find(
    (c) => c.name.toLowerCase() === company.toLowerCase()
  );

  return (
    match?.logo ||
    "data:image/png;base64,"
  );
};

export default getCompanyLogo;
